import { Navbar, Container, Nav, NavDropdown } from 'react-bootstrap';


const NavBar = () => {
    return(
      <>
      <Navbar bg="dark" variant="dark">
    <Container>
      <Navbar.Brand href="#home">
        <img
          alt=""
          src="/Images/Project.jpg"
          width="30"
          height="30"
          className="d-inline-block align-top"
        />{' '}
      aaa
      </Navbar.Brand>
    </Container>
  </Navbar>
</>
    )
}

export default NavBar;
